searchIndex['sentinel'] = {"items":[[0,"","sentinel","Sentinel cryptographically confirms the origin of a claim in a decentralised network.",null,null],[0,"sentinel","","Sentinel provides a consensus mechanism on all content messages.\nThe claims made must be identical and cryptographically signed.\nSentinel cryptographically confirms the origin of a claim in a decentralised network.",null,null],[3,"Sentinel","sentinel::sentinel","Sentinel is templated on an immutable Request type, a mergeable Claim type.\nIt further takes a Name type to identify claimants.\nSignature and PublicSignKey type are auxiliary types to handle a user-chosen\ncryptographic signing scheme.",null,null],[4,"AddResult","","",null,null],[13,"RequestKeys","","",0,null],[13,"Resolved","","",0,null],[8,"Source","","",null,null],[10,"get_source","","",1,{"inputs":[{"name":"source"}],"output":{"name":"name"}}],[11,"new","","This creates a new sentinel that will collect a minimal claim_threshold number\nof verified claims before attempting to merge these claims.\nTo obtain a verified claim Sentinel needs to have received a matching public\nsigning key. Each such a public signing key needs keys_threshold confirmations\nfor it to be considered valid and used for verifying the signature\nof the corresponding claim.",2,{"inputs":[{"name":"sentinel"},{"name":"usize"},{"name":"usize"}],"output":{"name":"sentinel"}}],[11,"add_claim","","This adds a new claim for the provided request. The claimant name and\nthe signature provided will be used to verify the claim with the keys\nthat are independently retrieved. When an added claim leads to the\nresolution of the request, the request and the claim are returned.\nAll resolved claims have to be identical. Otherwise None is returned.",2,{"inputs":[{"name":"sentinel"},{"name":"request"},{"name":"name"},{"name":"signature"},{"name":"serialisedclaim"}],"output":{"name":"option"}}],[11,"add_keys","","This adds a new set of public_signing_keys for the provided request.\nIf the request is not known yet by sentinel, the added keys will be ignored.\nWhen the added set of keys leads to the resolution of the request,\nthe request and the verified and merged claim is returned.\nOtherwise None is returned.",2,{"inputs":[{"name":"sentinel"},{"name":"request"},{"name":"name"},{"name":"vec"}],"output":{"name":"option"}}],[6,"SerialisedClaim","sentinel","",null,null]],"paths":[[4,"AddResult"],[8,"Source"],[3,"Sentinel"]]};
